    datas.map((data) => {
      console.log(data);
      setCountry(data);
    })
   
  };
  useEffect(() => {
    searchCountry();
  },[]);
  return (
    <>
      <div className="card-container">
        <div className="card">
          <div>
            <img className="image" alt="flag" src={logo} />
          </div>
          <div className="card-text">
            <h2>{country}</h2>
            <div className="flexit">
