              <p>Population:</p>
              <span>400,000</span>
            </div>
            <div className="flexit">
              <p>Region:</p>
              <span>Europe</span>
            </div>
            <div className="flexit">
              <p>Europe:</p>
              <span>Berlin</span>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default CountryCards;
